"use strict";

const heapify = require('heapq').heapify;
const heappush = require('heapq').heappush;
const heappop = require('heapq').heappop;

function f_gold(apples, days) {
    let q = [];
    let n = apples.length;
    let i = ans = 0;
    while (i < n || q.length > 0) {
        if (i < n && apples[i] > 0) {
            heappush(q, [i + days[i] - 1, apples[i]]);
        }
        while (q.length > 0 && q[0][0] < i) {
            heappop(q);
        }
        if (q.length > 0) {
            let [end, num] = heappop(q);
            num -= 1;
            ans += 1;
            if (num > 0 && end > i) {
                heappush(q, [end, num]);
            }
        }
        i += 1;
    }
    return ans;
}
